import { StyledContainer } from "./styles";
import { ContainerProps } from "../types";

const Container = ({
  border = false,
  backgroundImage = "",
  height = "100vh",
  children,
  padding = "",
  maxWidth = true,
}: ContainerProps) => (
  <StyledContainer
    border={border}
    backgroundImage={backgroundImage}
    height={height}
    padding={padding}
    maxWidth={maxWidth}
  >
    {children}
  </StyledContainer>
);

export default Container;
